<!DOCTYPE html>
<html>

<head>
	<meta charset="utf-8" />
	<meta http-equiv="X-UA-Compatible" content="IE=edge" />
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<title>Digital Display</title>
	<style id="applicationStylesheet" type="text/css">
		.mediaViewInfo {
			--web-view-name: artboard;
			--web-view-id: artboardId;
			--web-scale-on-resize: true;
			--web-enable-deep-linking: true;
		}

		:root {
			--web-view-ids: artboardId;
		}

		* {
			margin: 0;
			padding: 0;
			box-sizing: border-box;
			border: none;
		}

		#main {
			position: absolute;
			width: 600px;
			height: 448px;
			background-color: rgba(255, 255, 255, 1);
			overflow: hidden;
			--web-view-name: artboard;
			--web-view-id: artboardId;
			--web-scale-on-resize: true;
			--web-enable-deep-linking: true;
		}

		#name {
			transform: matrix(1, 0, 0, 1, 112.5, 201.5) rotate(90deg);
			transform-origin: center;
			left: 0px;
			top: 0px;
			position: absolute;
			overflow: visible;
			width: 399px;
			white-space: nowrap;
			text-align: center;
			font-family: Lucida Bright;
			font-style: normal;
			font-weight: bold;
			font-size: 36px;
			color: rgba(0, 0, 0, 1);
			letter-spacing: 0.1px;
		}

		#role {
			transform: matrix(1, 0, 0, 1, 166, 206) rotate(90deg);
			transform-origin: center;
			left: 0px;
			top: 0px;
			position: absolute;
			overflow: visible;
			width: 203px;
			white-space: nowrap;
			text-align: center;
			font-family: Lucida Bright;
			font-style: normal;
			font-weight: bold;
			font-size: 30px;
			color: rgba(229, 25, 25, 1);
			letter-spacing: 0.1px;
		}

		#pictureContainer {
			fill: rgba(12, 11, 11, 1);
			stroke: rgba(112, 112, 112, 1);
			stroke-width: 1px;
			stroke-linejoin: miter;
			stroke-linecap: butt;
			stroke-miterlimit: 4;
			shape-rendering: auto;
		}

		.pictureContainer {
			width: 449px;
			height: 243px;
			position: absolute;
			overflow: visible;
			transform: matrix(1, 0, 0, 1, 254, 102) rotate(90deg);
			transform-origin: center;
		}

		#picture {
			position: absolute;
			width: 225.694px;
			height: 225.694px;
			left: 365.653px;
			top: 111.153px;
			overflow: visible;
		}

		#statusContainer {
			fill: rgba(13, 13, 13, 1);
			stroke: rgba(112, 112, 112, 1);
			stroke-width: 1px;
			stroke-linejoin: miter;
			stroke-linecap: butt;
			stroke-miterlimit: 4;
			shape-rendering: auto;
		}

		.statusContainer {
			width: 449px;
			height: 63px;
			position: absolute;
			overflow: visible;
			transform: matrix(1, 0, 0, 1, -193, 192) rotate(90deg);
			transform-origin: center;
		}

		#status {
			transform: matrix(1, 0, 0, 1, -54, 207) rotate(90deg);
			transform-origin: center;
			left: 0px;
			top: 0px;
			position: absolute;
			overflow: visible;
			width: 171px;
			white-space: nowrap;
			text-align: center;
			font-family: Lucida Bright;
			font-style: italic;
			font-weight: normal;
			font-size: 28px;
			color: rgba(249, 249, 249, 1);
			letter-spacing: 0.1px;
		}
	</style>

</head>
